import 'package:flutter/src/widgets/container.dart';
import 'package:flutter/src/widgets/framework.dart';
import 'package:flutter/material.dart';
import 'package:sample_project/screen/login.dart';

class ScreenHome extends StatelessWidget {
  const ScreenHome({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        backgroundColor: Color.fromARGB(255, 49, 172, 11),
        title: const Text('WILDLIFE PHOTOGRAPHERS'),
        actions: [
          IconButton(
              onPressed: () {
                signout(context);
              },
              icon: Icon(Icons.exit_to_app)),
        ],
      ),
      body: SafeArea(
        child: ListView.separated(
          itemBuilder: (ctx, index) {
            if (index % 2 == 0) {
              return ListTile(
                title: Text('VARUN ADITHYA'),
                subtitle: Text('Where are you??? '),
                leading: CircleAvatar(
                  radius: 30,
                  backgroundColor: Colors.green,
                  backgroundImage: NetworkImage(
                      'data:image/jpeg;base64,'),
                ),
                trailing: Text('1$index:00 PM'),
              );
            } else {
              return ListTile(
                title: Text('AARZOO KHURANA'),
                subtitle: Text('Send me the Pics'),
                leading: ClipRRect(
                  borderRadius: BorderRadius.zero,
                  child: Image.network(
                    'data:image/jpeg;base64,',
                  ),
                ),
                trailing: Text('1$index:00 PM'),
              );
            }
            // ignore: dead_code
            ;
          },
          separatorBuilder: (context, index) {
            return Divider();
          },
          itemCount: 50,
        ),
      ),
    );
  }
}

signout(BuildContext ctx) async {
  final _sharedPrefs = await SharedPreferences.getInstance();
  await _sharedPrefs.clear();

  Navigator.of(ctx).pushAndRemoveUntil(
      MaterialPageRoute(builder: (ctx1) => ScreenLogin()), (route) => false);
}
